package com.example.backsgbdproject.service;

import com.example.backsgbdproject.controller.exceptions.ServiceException;
import com.example.backsgbdproject.entity.Game;
import com.example.backsgbdproject.entity.Review;
import com.example.backsgbdproject.repository.GameRepo;
import com.example.backsgbdproject.repository.ReviewRepo;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.stereotype.Service;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import java.util.Optional;


@Service
public class GameService {

    @Autowired
    private GameRepo gameRepo;

    private ReviewRepo reviewRepo;
    private ReviewService reviewService;

    public GameService(ReviewService reviewService) {
        this.reviewService = reviewService;
    }

    public Iterable<Game> getGames(){
        return gameRepo.findAll();
    }

    public Optional<Game> getGameById(String id){ return gameRepo.findById(id);}

    public List<Game> findByGenre(String genre) {
        return gameRepo.findByGenre(genre);
    }

    public Iterable<Review> getGameReviews(String id){ return gameRepo.findById(id).get().getReviews(); }
    public Game insertGame(Game game){
        return gameRepo.save(game);
    }

    public Game addReviewToGame(String gameId, Review _review) throws GameNotFoundException {
        Game game1 = gameRepo.findById(gameId).get();

        // Associate the review with the game
        _review.setGameId(gameId);

        reviewService.insertReview(_review);

        // Add the review to the game's list of reviews
        game1.getReviews().add(_review);

        // Save the updated game entity
        gameRepo.save(game1);
        return game1;
    }

    public Game create(String name, String company, List<String> genre, String description, double price, String img) {
        try {
            var game = new Game(name, company, genre, description, price, img);
            insertGame(game);
            return game;
        } catch (Exception ex) {
            throw new ServiceException(ex.getMessage());
        }
    }

    public void carregarBD(){
        create("Outer Wilds", "Mobius Digital", Arrays.asList("Exploración", "Espacio", "Misterio"), "Outer Wilds, nombrado juego del año 2019 por Giant Bomb, Polygon, Eurogamer y The Guardian, es un galardonado título de mundo abierto, que se desarrolla en un enigmático sistema solar confinado a un bucle temporal infinito.", 22.99,"data:image/jpeg;base64,");
        create("ELDEN RING", "FromSoftware Inc.", Arrays.asList("Mundo abierto", "Fantasía oscura"), "EL NUEVO JUEGO DE ROL Y ACCIÓN DE AMBIENTACIÓN FANTÁSTICA. Álzate, Sinluz, y que la gracia te guíe para abrazar el poder del Círculo de Elden y encumbrarte como señor del Círculo en las Tierras Intermedias.", 59.99, "data:image/jpeg;base64,");
    }
    public Game updateGame(Game game, String id){
        Game game1 = gameRepo.findById(id).get();
        game1.setName(game.getName());
        game1.setDescription(game.getDescription());
        game1.setGenre(game.getGenre());
        game1.setCompany(game.getCompany());
        game1.setPrice(game.getPrice());
        gameRepo.save(game1);
        return game1;
    }

    public void deleteGame(String id){ gameRepo.deleteById(id); }

    public List<Game> searchGames(String company, int rating, double price) {
        List<Game> games = new ArrayList<>();

        if (company != null && !company.isEmpty()) {
            games = gameRepo.findByCompany(company);
        }

        if (rating > 0) {
            List<Game> ratingGames = gameRepo.findByRatingGreaterThanEqual(rating);
            if (!games.isEmpty()) {
                games.retainAll(ratingGames);
            } else {
                games = ratingGames;
            }
        }

        if (price > 0) {
            List<Game> priceGames = gameRepo.findByPriceLessThanEqual(price);
            if (!games.isEmpty()) {
                games.retainAll(priceGames);
            } else {
                games = priceGames;
            }
        }

        return games;
    }

    public void setGameRating(String game_id, int rating) {
        Game game1 = gameRepo.findById(game_id).get();
        game1.setRating(rating);
        gameRepo.save(game1);
    }
}

